import styled from 'styled-components';

const StyledKeywordSearch = styled.div`
  height: 100%;
`;

const KeywordSearch = () => (
  <StyledKeywordSearch>
    <form>
      <input type="text" />
      <button>+</button>
    </form>
  </StyledKeywordSearch>
);

export default KeywordSearch;
